import React, { Component } from "react";
import axios from "axios";


class ComunaWS extends Component{

    state={
        comuna:[]
    }

    async componentDidMount(){
        this.getComunas();
    }

    getComunas(){
        axios.get('http://localhost:4000/API/comuna')
        // this.setState({Comuna:api.nom_com})
        .then(res => {
            const comuna = res.data;
            this.setState({comuna});

        })
    }

    render(){

        return(
            <React.Fragment>
                {this.state.comuna.map(com =>
                <div key={com.id_com}>
                    <li>{com.nom_com}<button className="float-end">Eliminar</button></li>
                    
                </div> 
                )}
            </React.Fragment>
        );       

    }
}

export default ComunaWS
